// client/src/components/Dashboard.tsx

import React from "react";

const Dashboard: React.FC = () => {
  return (
    <div>
      <h1>Carbon Footprint Tracker</h1>
      <p>Track your emissions and optimize supply chain solutions.</p>
    </div>
  );
};

export default Dashboard;
